"use strict";

const { default: defaultdict } = require("defaultdict");

function f_gold(n, reservedSeats) {
    const m = new defaultdict(Number);
    for (const [i, j] of reservedSeats) {
        m[i] = m[i] | (1 << (10 - j));
    }
    const masks = [0b0111100000, 0b0000011110, 0b0001111000];
    let ans = (n - m.size) << 1;
    for (const v of m.values()) {
        for (const mask of masks) {
            if ((v & mask) === 0) {
                v |= mask;
                ans += 1;
            }
        }
    }
    return ans;
}
